import React,{Component} from 'react';
import Client from '../consulta';
import TodoLabel from '../../src/componentes/biceLabel';

class BiceValores extends Component {
    constructor(props) {
      super(props);
      this.state = {
            extra:'',
            nick:'',
            msg:'',
            salida:'',
            value: '',
            valor:'',
            persona:{ 
                nick: '',
                msg: '',
                created: { type: '', default: '' }
                },
            };
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
      this.handleInsertar = this.handleInsertar.bind(this);
      this.handleInputChange = this.handleInputChange.bind(this);
      this.handleRemove = this.handleRemove.bind(this);

    }
  

    handleChange(event) {
      this.setState({value: event.target.value});
  }
  
    handleSubmit(event) {
        let parte=JSON.stringify(this.state.value);
        if(this.state.value){
            Client.search("{ nick:"+parte+" }", respuesta => {
                let guarda = (JSON.parse(respuesta));
                this.setState( {salida:guarda}); 
                this.refs.someName.value = '';
            });      
       }
      event.preventDefault();
    }

    handleInputChange(event) {
        const target = event.target;
        const value =  target.value;
        const name = target.name;
        
        if(name==='nick'){
            this.setState( {nick: value } ); 
        }
        if(name==='msg'){
            this.setState( { msg: value } ); 
        }
        event.preventDefault();
      }


    render() {
      
      return (


        <div>

                <TodoLabel valor="UF=" nombre="1.3456"/>
                <TodoLabel valor="Pesos=" nombre="1.1456"/>
                <TodoLabel valor="Dolar=" nombre="1.2456"/>

            <div className="card text-white bg-primary mb-12" >
                      <form action="/" method="get" >
                          <button className="btn btn-primary"type="submit">Volver</button>
                       </form>                
                </div>         
            </div>
    //    <div className="card text-center border-info"> 

    //     <div className="card text-center border-info">
    //       <div className="card-body">
    //         <h4 className="card-title">Valores del d√≠a</h4>
    //     </div>   
    //     </div>   
    //     </div>   


      );
    }
  }
export default BiceValores;
